def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    priorities = np.zeros(len(bins))

    for i in range(len(bins)):
        if item <= 0:
            priorities[i] = np.inf
        elif bins[i] >= item:
            priorities[i] = 1.0
        else:
            priority_sum = 0
            for j in range(len(bins)):
                if bins[j] > 0:
                    priority_sum += bins[j]

            if item > priority_sum:
                priorities[i] = item / priority_sum
            else:
                priorities[i] = bins[i] / priority_sum

    max_priority = np.max(priorities)
    min_priority = np.min(priorities)

    for k in range(len(priorities)):
        if priorities[k] == max_priority:
            priorities[k] = max_priority * 1.5
        elif priorities[k] == min_priority:
            priorities[k] = min_priority * 0.75

    return priorities
